import { React, useEffect, } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import Dog from "./Dog";
import { getDogs } from './../../redux/actions';

export default function Dogs() {
    let dogs = useSelector((state) => state.dogs)
    //console.log(dogs);
    let dispatch = useDispatch();
    useEffect(() => {
        dispatch(getDogs());
    }, [])

    //handlers
    function handlerClick(event) {
        event.preventDefault();
        dispatch(getDogs());

    }
    //console.log(dogs, "*****ALl info de api en back*****");
    if (dogs.length !== 0) {
        return <div> <h1>Home</h1>
            <button onClick={e => { handlerClick(e) }}> pARA refrech page</button>
            <div>
                <select>
                    <option>Temperamento</option>
                </select>
                <select>
                <option>All Raza</option>
                <option>Api Razas</option>
                <option>Created Razas</option>
                </select>
                <select>
                <option value='asc'>A-Z</option>
                <option value='desc'>Z-A</option>
                </select>
                <select>
                <option value='minW'>Min-May weight</option>
                <option V>May-Min weight</option>
                </select>
                <button> Search</button>
                </div>

            <div>{/* <SearchBar></SearchBar> */}</div>
            <div>
                {dogs.map((e) => {
                    return <Link key={e.id} to={`/home/${e.id}`}>
                        <Dog name={e.name} img={e.img} temperament={e.temperament} height={e.height} weight={e.weight} life={e.life} />
                    </Link>

                })}
            </div>
        </div>
    } else {
        return <div>
            <h1>Cargando...</h1>
        </div>
    }
}
